// RainAnimation.js
import React from 'react';
import './MonsoonAnimation.css';

const RainAnimation = () => {
  const createRaindrops = () => {
    const drops = [];
    for (let i = 0; i < 100; i++) {
      const dropStyle = {
        left: `${Math.random() * 100}vw`,
        animationDuration: `${Math.random() * 2 + 2}s`,
        animationDelay: `${Math.random() * 3}s`,
      };
      drops.push(<div className="drop" style={dropStyle} key={i}></div>);
    }
    return drops;
  };

  return <div className="rain-animation">{createRaindrops()}</div>;
};

export default RainAnimation;
